(1467, 1, '500', '  ', 1, 'a', '\"Despite their shared history and the potential benefits of cooperation in the twenty-first century, a bilateral and multilateral relationship among Africa, Latin America, and the Caribbean remains an overlooked possibility. Using a multidisciplinary approach, this book advocates for increased and renewed cooperation among the regions\"-- Provided by publisher.'),
