INSERT INTO `letter_formats` (`letter_name`, `letter_format`, `subject`, `letter_fullname`) VALUES
('app_letter', 'Dear Sir/Madam\r\n\r\nI am sending herewith a list of approved items which have been suggested by you or member of your department for  including in the library    \r\n\r\n  Yours faithfully,   \r\n    (Librarian)', 'Subject : Approval letter', 'Letter for Approval'),
('can_order', 'Dear Sir/Madam         This has reference to our above mentioned order relating to supply of the items as per enclosed list. This order may be treated as cancelled      Yours faithfully    (Librarian)', 'Subject : Cancellation of order', 'Cancellation of Order'),
('can_remin_lett', 'Dear Sir/Madam,      This has reference to our previous reminder. Please cancel the reminder sent by us. Because we don\'t need that item urgently.   Yours faithfully,  (Librarian)', 'Subject : Cancel Reminder letter', 'Cancellation of Remiinder'),
('fwd_acc_scm', 'Dear Sir/Madam    We have received invoices with following details, It is being requested to process the payment for the same.    Librarian', 'Subject : Request for Payment', 'Forwarding letter to Account Section for Serial Control Module'),
('Fwd_letter', 'Dear Sir/Madam', 'Subject:  Forwarding Letter For Serials', 'Fowarding Letter to Account Section of Serials'),
('Fwd_letter_acq', 'Dear Sir/Madam', 'Subject:  Forwarding Letter for Books', 'Fowarding Letter to Account Section of Books'),
('fwd_vendor_scm', 'Dear Sir/Madam    We have received invoices with following details, It is being requested to process the payment for the same.    Librarian', 'Subject : Forwarding Letter for Payment', 'Forwarding Letter to Vendor intimating Payment'),
('ILL_Arrival', 'Dear Sir    As per your request following items has been arrived to library on Inter library loan, You are requested to get it issued at earliest      Librarian', 'Subject: Inter Library Loan Arrival Intimation', 'ILL Arrival Intimation Notice'),
('ILL_Request', 'Dear Sir/Madam,       Following item(s) are being requested on Inter Library Loan as per aggreement, you are requested to supply the same at earliest      Librarian', 'subject : Inter Library Loan request', 'ILL Request Letter'),
('inti_lette', 'Dear Sir/Madam,    Please find the enclosed list of items suggested by you/Member of your department.      Yours faithfully,    (Librarian)', 'Subject : Item arrival intimation', 'Intimation letter'),
('NoDue', 'It is being informed that This member is not having any due in library', 'Subject : No Due Certificate', ' No Due Certificate Letter'),
('pur_order', 'Dear Sir/Madam          Please supply the item(s) as per  enclosed list to the library on or beforeabove mentioned  expected date as per following conditions. Please note that any discrepancy  if found in supply, you should be responsible for it and yor will have to bear the cost of returning the books.    1.Books of the latest edition are to be supplied /as case may be.  2.The price should be indicated in the original currencies. These should be converted in accordance with approved  conversion rate of GOC.  3.If the supply is sent by post, the books should be sent per registered post. V.P.P. will not be accepted.  4. The books supplied must be physically  in order, otherwiswise these will be returned to you at your own cost.  5. The bill should be in triplicate. In case of foreign currency, you have to produce price proof.      Yours faithfully    Asst. Librarian    ', 'Subject : Purchase Order', 'Purchase order'),
('relpay_let', 'Dear Sir/Madam,    Please find enclosed herewith  a list of items received by us along with details. These items have been duly accessioned by us. You are requested to release  payment for the same.      Yours faithfully,    (Librarian)              ', 'Subject : Release of payment', 'Letter for Release of Payment'),
('remin_lett', 'Dear Sir/Madam,    This has reference to our orders as per following details, for supply of books.The delivery date is alredy over.  You are requested to supply the same within 7  days,failing  which order is liable to be cancelled.      Yours faithfully,    (Librarian)    ', 'Subject : Reminder letter', 'Reminder for Non Supply of Books'),
('remin_scm', 'Dear Sir/Madam    With reference to above subject, we have ordered through your agency the following Journals. We find that the issues mentioned against each title below. Enclosed sheet which are overdue have not received in the library.    Librarian', 'Subject : Reminder Letter', 'Reminder for Non Supply of Serials'),
('reminder_cir', 'Dear Sir/Madam, You are requested to return listed books within 7 days. Yours Faithfully,(Librarian)', 'Subject : Reminder/Recall  Letter', 'Reminder/Recall for Return Book');
